<meta charset="utf-8">
<title></title>
<style type="text/css">
html {overflow-x: hidden;}
body {background-color:#F8F8F8;}
.hi{width:100%;position:absolute;top:30%;display:inline-flex;justify-content:center;}.txt1{font-family:proxima nova;font-size:24px;font-weight:400;color:#3E4045;margin-bottom:12px;}.logo{margin-bottom:36px;}.img1{margin-bottom:36px;font-family:blender pro;font-weight:700;font-size:36px;color:#222222;}.cn{display:flex;justify-content:center}
.mirrors{display:grid;grid-template-columns:repeat(4, 120px);grid-template-rows: repeat(3, 50px); grid-column-gap: 10px; grid-row-gap: 10px;padding-top:30px}
.mirror1 {grid-area: 1/1/2/2;}
.mirror2 {grid-area: 1/2/2/3;}
.mirror3 {grid-area: 1/3/2/4;}
.mirror4 {grid-area: 1/4/2/5;}
.mirror5 {grid-area: 2/1/3/3;}
.mirror6 {grid-area: 2/3/3/4;}
.mirror7 {grid-area: 2/4/3/5;}
.mirror8 {grid-area: 3/1/3/6;}
.mirror9 {grid-area: 3/3/4/5;}
.mirror{text-align: center;border: 3px solid;border-radius:5px;border-color:#ccc;}
.mirror:hover{
    background-image: linear-gradient(to right, #eb3941, #f15e64, #e14e53, #e2373f);
    box-shadow: 0 5px 15px rgba(242, 97, 103, 0.4);
    transition: all .4s ease-in-out;
    }
.mirror:active{box-shadow: inset 1px 1px 10px -1px}
a {
    text-decoration: none;
    text-transform: uppercase;
    font-size: 12px;
    font-family:'Proxima Nova Rg';
}
a span {
    padding:5px;
    transition: .5s;
    position: relative;
}
a span .clear {
    padding:5px;
    transition: .5s;
    position: relative;
}
a span:nth-child(1) {
    color: #000;
    font-weight: bold;
}
a span:nth-child(2) {
    color: #fff;
    background: #ff3636;
    font-weight: bold;
}
a span:nth-child(1):before {
    content: attr(data-attr);
    position: absolute;
    top: 0;
    left: 0;
    background: #ff3636;
    padding:7px;
    transition: 0.5S;
    transform-origin: top;
    transform: rotateX(90deg) translateY(-50%);
    border-top-left-radius: 5px;
    border-bottom-left-radius: 5px;
}
a:hover span:nth-child(1):before {
    transform: rotateX(0deg) translateY(0%);
} 
a span:nth-child(2):before {
    content: attr(data-attr);
    position: absolute;
    top: 0;
    left: 0;
    background: #aaa;
    padding:7px;
    transition: 0.5S;
    transform-origin: bottom;
    transform: rotateX(90deg) translateY(50%);
    border-top-right-radius: 5px;
    border-bottom-right-radius: 5px;
}
a:hover span:nth-child(2):before {
    transform: rotateX(0deg) translateY(0%);
} 
a  span:nth-child(1):after {
  content:attr(data-attr);
  padding:7px;
  position: absolute;
  top: 0;
  left: 0;
  background: /*#262626*/#aaa;
  transform-origin: bottom;
  transform: rotateX(0deg) translateY(0%);
  transition: 0.5s;
  border-top-left-radius: 5px;
  border-bottom-left-radius: 5px;
}
a:hover span:nth-child(1):after {
  transform: rotateX(90deg) translateY(50%);
}
a span:nth-child(2):after {
    content: attr(data-attr);
    position: absolute;
    top: 0;
    left: 0;
    background: #ff3636;
    padding:7px;
    transition: 0.5S;
    transform-origin: top;
    transform: rotateX(0deg) translateY(0%);
    border-top-right-radius: 5px;
    border-bottom-right-radius: 5px;
}
a:hover span:nth-child(2):after {
    transform: rotateX(90deg) translateY(-50%);
} 
@font-face {
    font-family: 'Proxima Nova Rg';
    src: url('fonts/ProximaNova-Regular.eot');
    src: local('fonts/Proxima Nova Regular'), local('ProximaNova-Regular'),
        url('fonts/ProximaNova-Regular.eot?#iefix') format('embedded-opentype'),
        url('fonts/ProximaNova-Regular.woff') format('woff'),
        url('fonts/ProximaNova-Regular.ttf') format('truetype');
    font-weight: normal;
    font-style: normal;
}
</style>
